// SPDX-License-Identifier: MIT

/// @title <Titulo del contrato>
/// @author <Autor del contrato>
/// @notice <Explicar lo que hace el contrato o funcion>
/// @dev <Detalles adicionales sobre el contrato o funcion>
/// @param <valor_retorno> <Describir para que sirve el valor de retorno>


pragma solidity ^0.8.1;


contract Owner {
    address public owner;

    constructor()  {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        if (msg.sender == owner)
            _;
    }
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0),"Direccion no valida");
        owner = newOwner;
    }

   
}

